You Mist & Soft'Lit go together like... 💖

@samanthaarandazzo wears our NEW #YouMist Makeup-Extending Setting Spray paired with #SoftLit Luminous Longwear Foundation in '210' ✨ This hybrid 2-in-1 formula combines the skin-loving ingredients of a finishing mist with a high-performance setting spray for a flexible veil that extends makeup wear up to 12 hours 💅🏽💅🏻💅🏿 

Shop #YouMist at @sephora, @sephoracanada, @kohls #sephoraxkohls, @ultabeauty, @bootsuk and fentybeauty.com! 💋

Kiss it better with a Love Bomb lip combo 💋 This is a shimmering hot pink twist to the classic red lip you know & love 🫶🏽🫶🏿🫶🏻

@leesondra_ wears Trace'd Out Pencil Lip Liner in 'The MVP' paired with our NEW Gloss Bomb Shimmer Stix in 'Flamingo Fling' 💖 

Add this shimmery red & pink Fenty lip combo to cart at @sephora, @sephoracanada, @ultabeauty, @bootsuk & fentybeauty.com!
